import base64

file = ""
decoded = base64.decodebytes(file.encode("ascii"))
processed = "".join(["{:08b}".format(x) for x in decoded])

alertVersion = int(processed[0:32], 2)
epoch = int(processed[32:64], 2)
confidence = int(processed[96:104], 2)/(2**8)
width = int(processed[128:144], 2)
height = int(processed[144:160], 2)
skeletonX = int(processed[160:176], 2)
skeletonY = int(processed[176:192], 2)
event = int(processed[192:200], 2)
frames = int(processed[208:224], 2)

